			{co:"BA",na:"Booking Agent",nat:"EXP",at:"CARRIER;CHB;WH;TP;CMN",dt:"TP;WH;CHB;CARRIER;CMN",mt:"CARRIER",ac:true,def:"As nominated by carrier to be their agent to handle/manage their booking and it will require to execute the complete export process like export customs clearance, transportation, warehousing and consolidation etc.",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"TLE",na:"Export Customs Clearance Service",nat:"EXP",at:"CHB",dt:"CHB",mt:"CHB",ac:true,def:"Assist exporters to manage and complete the customs declaration process like document collection \u0026 verification, submission to government authorities \u0026 complete the declaration requirements etc.",avt:null},{co:"ELS",na:"Export Freight Forwarding",nat:"EXP",at:"CARRIER;CHB;WH;TP;CMN",dt:"TP;WH;CHB;CARRIER;CMN",mt:"TP||WH||CHB||CARRIER",ac:true,def:"Provides exporters/vendors/manufacturers with a single point of contact to manage and execute the complete export process like carrier coordiantion for shipment export, export document preparation and customs clearance, domestic transportation, warehousing and consolidation etc.",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"HF",na:"Hub Forwarding",nat:"ERI",at:"CARRIER;CHB;WH;TP;CMN",dt:"TP;WH;CHB;CARRIER;CMN",mt:"CARRIER",ac:true,def:"As handling agent:\u003cbr /\u003e- Carrier coordination for import and export at Hub port\u003cbr /\u003e- Customs formalities preparation",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"TLI",na:"Import Customs Clearance Service",nat:"IMP",at:"CHB",dt:"CHB",mt:"CHB",ac:true,def:"Manage and complete the import customs clearance process \u0026/or CIQ process  like document collection \u0026 verification, submission to government authorities \u0026 complete the declaration requirements, taxes \u0026 duties settlement on behalf of importers etc.",avt:null},{co:"IF",na:"Import Freight Forwarding",nat:"IMP",at:"CHB;WH;TP;CMN;CARRIER",dt:"CHB;WH;TP;CMN;CARRIER",mt:"TP||WH||CHB||CARRIER",ac:true,def:"Provides importers with a single point of contact to manage its worldwide incoming shipments through the import process, centrally serving the logistics functions like carrier coordination for inbound arrival, import customs clearance, terminal pickup and inland delivery, warehousing and de-consolidation etc.",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"ID",na:"Local (City) Storage \u0026 Distribution",nat:"DOM",at:"WH;TP;CMN",dt:"TP;WH;CMN",mt:"WH\u0026TP",ac:true,def:"Warehouse in/out, storage, inventory management and value added services, plus local delivery service in versatile ways.",avt:"CTR;LTR"},{co:"ERI",na:"Mainland China Export \u0026 Re-Import via BLP",nat:"ERI",at:"CHB;WH;TP;CMN;CARRIER",dt:"CARRIER;TP;WH;CHB;CMN",mt:"CHB",ac:true,def:"Provides customers manage and execute the export \u0026 re-import process via BLP for tax benefits and time saving.  Services include customs clearance for both export \u0026 re-import, warehousing service including pick \u0026 pack ,kitting and etc at BLP, coordination for VAT/export tax refund, transportation to/from BLP etc.",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"SW",na:"Standard Storage Service",nat:"DOM",at:"WH;CMN",dt:"WH;CMN",mt:"WH",ac:true,def:"Provides warehouse services e.g. warehouse in/out, storage, cross dock, pick \u0026 pack, etc and value added services, returned goods management inventory management service.",avt:null},{co:"ST",na:"Standard Transportation Service",nat:"DOM",at:"TP;CMN",dt:"TP;CMN",mt:"TP",ac:true,def:"Assist customers to manage and execute transportation orders. Transport modes can be truck, rail, barge, coastal feeder, air. OLL contract with customer as the domestic transportation carrier.",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"OTH",na:"Others",nat:"DOM",at:"CMN",dt:"CMN",mt:"CMN",ac:true,def:"Domestic services not covered in the other DMLOG products like 4PL and etc.",avt:null},{co:"FIO",na:"OCS Dummy Product - IB \u0026 OB",nat:"ERI",at:"TP;CHB;CMN",dt:"TP;CHB;CMN",mt:null,ac:true,def:"It\u0027s a dummy product in DB for OCS CSA to handle the case that Inbound and Outbound can apply different services.",avt:null},{co:"4PL",na:"4th Party Logistics",nat:"DOM",at:"CMN",dt:"CMN",mt:"CMN",ac:true,def:"4th Party Logistics services not covered in the other DMLOG products ",avt:null},{co:"SCM",na:"Supply Chain Management System",nat:"DOM",at:"CMN",dt:"CMN",mt:"CMN",ac:true,def:"Supply Chain Management System services not covered in the other DMLOG products ",avt:null},{co:"CTW",na:"Control Tower",nat:"ERI",at:"WH;TP;CHB;CARRIER;CMN",dt:"WH;TP;CHB;CARRIER;CMN",mt:"WH||TP||CHB||CARRIER||CMN",ac:true,def:"Control Tower",avt:"CTR;LTR;AIR;BAR;CTF;RLW"},{co:"SA",na:"Shipping Agent",nat:"IMP",at:"CMN",dt:"CMN",mt:"CMN",ac:true,def:"Shipping Agent",avt:null}
